export const fetchHelper = async ({ endpoint, method, data }) => {
    var result = fetch(`http://${urlHead}${endpoint}` + "/", {
        method: method,
        headers: {
            'Content-Type': 'application/json'
        },
        body: data,
        mode: 'cors',
    })
    return result;
}
